import React, { useEffect } from "react";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import Select from "@material-ui/core/Select";
import { getSchoolYear, getGradeLevel } from "../features/schoolSlice";
import { useSelector, useDispatch } from "react-redux";

function CreateClassroom() {
  const dispatch = useDispatch();
  const schoolYear = useSelector((state) => state.school.schoolYear);
  const level = useSelector((state) => state.school.gradeLevel);
  const token = useSelector((state) => state.auth.token);

  console.log(schoolYear);
  console.log(level);
  console.log(token);
  useEffect(() => {
    dispatch(getSchoolYear(token));
    dispatch(getGradeLevel(token));
  }, []);

  return (
    <div className="classroom__create">
      <div className="classroom__name">
        <input placeholder="Name" />
        <input placeholder="Schedule" />
      </div>
      <div className="classroom__details">
        <InputLabel id="level">Grade Level</InputLabel>
        <Select labelId="level" id="level">
          <MenuItem value="hello">Grade 8</MenuItem>
          {level &&
            level.map((item) => {
              <MenuItem value={item.id}>{item.name}</MenuItem>;
            })}
        </Select>
        <InputLabel id="schoolyear">School Year</InputLabel>
        <Select labelId="schoolyear" id="schoolyear" value={"hello"}>
          <MenuItem value="hello">2020-2021</MenuItem>
        </Select>
      </div>
    </div>
  );
}

export default CreateClassroom;
